import './card.scss';
import { Link } from 'react-router-dom';


function Card({item}) {
  return (
    <div className='card'>
      <Link to={`/${item.id}`} className='imageContainer'>
        <img src={item.images} alt="" /></Link>


      <div className="textContainer">
        <h2 className="tite">
          <Link to={`/${item.id}`}>{item.title}</Link>
        </h2>
      </div>
    </div>

  )
}

export default Card
